const Login =()=>{
    return(
        <div className="mycard">
        <div className="card auth-card">
        <h2>Instagram</h2>
        <input type="text" placeholder="email" />
        <input type="password" placeholder="password" />
        <button classN="btn waves-effect waves-light">Submit</button>
      </div>
      </div>
    )
}
export default Login;
